(2, 'Auto', 'auto', 'The tech and car industries go hand in hand sometimes, so it does not hurt to take a look at what innovations and novelties appear on the other front as well.', 'Auto_1630659830.jpg', '<p>The tech and car industries go hand in hand sometimes, so it doesn&#39;t hurt to take a look at what innovations and novelties appear on the other front as well.</p>', 1010, 1, 40, '2021-08-18 18:47:57', '2021-11-10 17:39:08', 'Auto', 'The tech and car industries go hand in hand sometimes, so it does not hurt to take a look at what innovations and novelties appear on the other front as well.', 'tech, auto, tesla, internet, electric, software, IOS, Android'),
(4, 'Internet', 'internet', 'Qui sit rerum voluptatibus in sapiente amet porro.', 'Internet_1631565299.jfif', '<p>Iusto molestias placeat suscipit. Dolorem soluta tempore reiciendis quibusdam. Consectetur aspernatur aut earum occaecati laboriosam delectus optio. Ipsum quaerat et id.</p>', 2458, 1, 20, '2021-08-18 18:47:57', '2021-11-07 18:24:53', 'Internet', 'molestiae exercitationem aut deleniti architecto dolorum odit ea in totam ab', 'internet, web, site,  test,  speed, dsl, providers'),
(6, 'Science', 'science', 'Qui sit rerum voluptatibus in sapiente amet porro.', 'Science_1631565326.jpg', '<p>Nam distinctio et voluptas temporibus et et ut voluptatem. Voluptas quasi corrupti qui qui nisi est ea dolor. Tenetur voluptate eum sint. Saepe animi praesentium voluptas nesciunt sunt nam quis.</p>', 2133, 1, 50, '2021-08-18 18:47:57', '2021-11-10 17:41:39', 'Science', 'eos maxime unde nam quasi et nam ut dolores explicabo et voluptatem molestiae', 'science, Earth, planet, Mars, Sun, Covid, fly, speed'),
(9, 'Tech', 'tech', 'This section is dedicated to tech products, from phones and PCs to Hi-Fi and photo-video equipment.', 'Tech_1631565349.jpg', '<p>This section is dedicated to tech products, from phones and PCs to Hi-Fi and photo-video equipment.</p>', 141, 1, 10, '2021-08-24 14:22:05', '2021-11-06 07:28:27', 'Tech', 'This section is dedicated to tech products, from phones and PCs to Hi-Fi and photo-video equipment.', 'tech, pc, phone, software, hardware, IOS, android,  hifi, tv, foto, video');
