(101, 'MacBook Pro 2021 rumors: Release date, price, M1X and more', 'macbook-pro-2021-rumors-release-date-price-m1x-and-more', 'Significant changes to the MacBook Pro line are rumored to include a new 14-inch size, more powerful M1X processor, mini LED screen and no Touch Bar.', 'MacBookPro.jpg', '<p>If you&#39;ve been holding off on&nbsp;shelling out for a new MacBook Pro&nbsp;out of FOMO or indecision, this fall may hold the answers you&#39;ve been waiting for. Just not yet.&nbsp;Apple&#39;s big event today&nbsp;only offers a slim chance we&#39;ll get information about the new models -- though there may be clues buried in its presentation for the upcoming&nbsp;iPhone 13&nbsp;and related devices.&nbsp;</p>', '<p>It&#39;s highly likely that the company will launch its MacBook Pros or other new Macs in a follow-up event in October, as it has tended to do. (Mark Gurman of Bloomberg corroborates this: &quot;There will be two events,&quot;&nbsp;<a href=\"https://twitter.com/markgurman/status/1437140403803672581\" target=\"_blank\">according to a recent tweet</a>&nbsp;of his.) And based on some reliable rumormongering, there might be some big changes, including a new higher-powered version of&nbsp;<a href=\"https://www.cnet.com/tech/computing/apple-gives-macs-brain-transplant-new-arm-chips-starting-this-year-wwdc-2020/\">Apple&#39;s M1 processor</a>&nbsp;in all models, a new 14-inch MacBook Pro, new&nbsp;<a href=\"https://www.cnet.com/tech/home-entertainment/mini-led-tv-what-makes-samsung-neo-qled-lg-qned-and-tcl-od-zero-so-special/\">mini LED-based screens</a>&nbsp;similar to that of the&nbsp;<a href=\"https://www.cnet.com/tech/computing/apple-ipad-pro-review-new-screen-5g-and-m1-chip-but-fyi-its-still-not-a-mac/\">12.9-inch iPad Pro</a>, the return of much-missed connectors and the ditching of the&nbsp;<a href=\"https://www.cnet.com/news/apple-macbook-pro-touch-problems-commentary/\">not-much-loved Touch Bar</a>.</p>', '<p>If you&#39;ve been holding off on&nbsp;<a href=\"https://www.cnet.com/tech/computing/maybe-you-should-wait-on-buying-that-new-mac-then-again-maybe-not/\">shelling out for a new MacBook Pro</a>&nbsp;out of FOMO or indecision, this fall may hold the answers you&#39;ve been waiting for. Just not yet.&nbsp;<a href=\"https://www.cnet.com/tech/mobile/apple-event-recap-iphone-13-lineup-and-everything-else-announced-today/\">Apple&#39;s big event today</a>&nbsp;only offers a slim chance we&#39;ll get information about the new models -- though there may be clues buried in its presentation for the upcoming&nbsp;<a href=\"https://www.cnet.com/tech/mobile/iphone-13-is-here-apple-gave-it-some-big-battery-storage-and-camera-upgrades/\">iPhone 13</a>&nbsp;and related devices.&nbsp;</p>\r\n\r\n<p>It&#39;s highly likely that the company will launch its MacBook Pros or other new Macs in a follow-up event in October, as it has tended to do. (Mark Gurman of Bloomberg corroborates this: &quot;There will be two events,&quot;&nbsp;<a href=\"https://twitter.com/markgurman/status/1437140403803672581\" target=\"_blank\">according to a recent tweet</a>&nbsp;of his.) And based on some reliable rumormongering, there might be some big changes, including a new higher-powered version of&nbsp;<a href=\"https://www.cnet.com/tech/computing/apple-gives-macs-brain-transplant-new-arm-chips-starting-this-year-wwdc-2020/\">Apple&#39;s M1 processor</a>&nbsp;in all models, a new 14-inch MacBook Pro, new&nbsp;<a href=\"https://www.cnet.com/tech/home-entertainment/mini-led-tv-what-makes-samsung-neo-qled-lg-qned-and-tcl-od-zero-so-special/\">mini LED-based screens</a>&nbsp;similar to that of the&nbsp;<a href=\"https://www.cnet.com/tech/computing/apple-ipad-pro-review-new-screen-5g-and-m1-chip-but-fyi-its-still-not-a-mac/\">12.9-inch iPad Pro</a>, the return of much-missed connectors and the ditching of the&nbsp;<a href=\"https://www.cnet.com/news/apple-macbook-pro-touch-problems-commentary/\">not-much-loved Touch Bar</a>.</p>\r\n\r\n<h2>A more powerful Apple M1X (or M2) CPU?</h2>\r\n\r\n<p>This is pretty much a given. Apple&#39;s M1 CPU has made it as far as the MacBook Air, 13-inch MacBook Pro, 24-inch iMac, Mac Mini and iPads, but thus far we haven&#39;t seen any of Apple&#39;s home-grown silicon in systems for power users. Multiple sources agree that there will be a new version of the CPU -- and&nbsp;<a href=\"https://www.cnet.com/tech/computing/apples-m2-chip-has-reportedly-entered-mass-production/\">sources indicating that it&#39;s already in production</a>&nbsp;-- for the larger MacBook (currently a 16-inch screen version), and possibly for upcoming new desktops.&nbsp;</p>\r\n\r\n<p>There&#39;ve also been rumors that there will be&nbsp;<a href=\"https://www.bloomberg.com/news/articles/2021-05-18/apple-readies-macbook-pro-macbook-air-revamps-with-faster-chips\" target=\"_blank\">two variants of the new chip</a>, both with 10 cores (eight high-performance and two energy efficient), but with different integrated graphics core configurations: 16 or 32. In contrast, the M1 has eight cores, split equally between performance and power saving, and either seven or eight graphics cores. Doubling or quadrupling the number of cores promises significantly better performance that, in combination with the tight integration with MacOS, could rival the performance of a discrete AMD GPU. And it&#39;s unclear whether a discrete GPU remains an option.&nbsp;</p>\r\n\r\n<p><img alt=\"009-imac-7-colors-2021-m1-announced.png\" src=\"https://www.cnet.com/a/img/0258PyrSR0kwrcTr8cnXaWTQ40c=/1092x0/2021/04/20/23a81af3-d43c-4c09-90ab-38d9212cc60a/009-imac-7-colors-2021-m1-announced.png\" style=\"height:615px; width:1092px\" /></p>\r\n\r\n<p>A higher-power version of Apple&#39;s M1 chip may be on the horizon.</p>\r\n\r\n<p>Screenshot/Apple</p>\r\n\r\n<p>Having two variants (with rumors of future versions with even more core options intended for the Mac Mini and Mac Pro) makes a lot of sense: In my testing, the M1 chip has performed almost identically regardless of device, giving the iPad as much power as the Mac Mini. That doesn&#39;t make sense for buyers of high-end equipment, where opting for a lesser processor can potentially save you thousands or where a discrete GPU may be essential.&nbsp;</p>\r\n\r\n<p>The two variants could explain why guesses about the name of the new CPU, M1X or M2, haven&#39;t tipped conclusively toward one or the other.&nbsp;</p>\r\n\r\n<p>As for Intel offerings, as early as last January we began hearing predictions that&nbsp;<a href=\"https://www.imore.com/huge-macbook-pro-leaks-promise-massive-upgrade-and-shock-omission\" target=\"_blank\">there wouldn&#39;t be Intel versions of the MacBook Pros</a>&nbsp;and to date there haven&#39;t been any indications to the contrary.</p>\r\n\r\n<h2>When will we be able to buy them?</h2>\r\n\r\n<p>Thanks to chip shortages, you probably won&#39;t be able to get one right after they&#39;re announced. Earlier this month there were&nbsp;<a href=\"https://www.macworld.com/article/346129/2021-macbook-pro-14-inch-16-inch-mini-led-m1x-touch-bar-price-release.html\" target=\"_blank\">reports that the shortages would at least delay shipments</a>&nbsp;until around the end of October or early November. And those delays are independent of the roadblocks to producing the mini LED-based screens,&nbsp;<a href=\"https://www.macrumors.com/2021/05/18/redesigned-macbook-pro-launch-limited-supply/\" target=\"_blank\">which may result in only a limited volume</a>&nbsp;of laptops available in 2021.</p>\r\n\r\n<h2>A new size, but at a higher starting price?</h2>\r\n\r\n<p>In addition to an upgraded model of a 16-inch MacBook Pro, we might be in for a 14-inch replacement for the 13-inch MacBook Pro, which could mean a 14-inch screen that fits into the chassis roughly the same size as the 13 -- thanks to smaller screen bezels. That follows a similar trend we&#39;ve seen in Windows laptops and the same approach Apple took when it transitioned from the 15-inch to 16-inch MacBook Pro models.&nbsp;</p>\r\n\r\n<p>Unfortunately, everyone thinks&nbsp;<a href=\"https://twitter.com/dylandkt/status/1430010276473102336?s=20\" target=\"_blank\">there will be a price hike for the 14-inch model</a>&nbsp;over the 13-inch, starting at closer to the top end of the latter&#39;s price range. Given the more expensive screen technology and current shortages, I wouldn&#39;t be surprised. It makes you wonder if Apple will continue to offer the M1-based MacBook Pro 13 as a lower-cost option.</p>\r\n\r\n<p><img alt=\"ipad-pro-m1-2021-cnet-2021-047\" src=\"https://www.cnet.com/a/img/Fm6E9jjZDb8n33Cgk87n54nu94o=/1092x0/2021/06/03/606dc31c-dbb6-40ef-95e5-371a49d88662/ipad-pro-m1-2021-cnet-2021-047.jpg\" style=\"height:819px; width:1092px\" /></p>\r\n\r\n<p>We expect the MacBook Pros to have mini LED-backlit displays like the iPad Pro 12.9 (left).</p>\r\n\r\n<p>Scott Stein/CNET</p>\r\n\r\n<h2>A whizzy new mini LED screen?</h2>\r\n\r\n<p>A mini LED-backlight-based display seems to be another given, and an extremely welcome one: It would allow MacBook Pros to better support HDR at higher brightness and with better local dimming, essential for video editing or producing content for the 12.9-inch iPad Pro and its mini LED-based screen. Hopefully, it will be accompanied by an update allowing the MacBook Pro to&nbsp;<a href=\"https://support.apple.com/en-us/HT210980\" target=\"_blank\">play HDR content in 4K</a>.</p>\r\n\r\n<h2>A new aesthetic?</h2>\r\n\r\n<p>Rumors here vary. Almost every device Apple has announced this year, from the iPad to the iMac, has adopted the flat-edged profile aesthetic that harkens back to the iPhone 4. But it remains to be seen if Apple will adopt that for the MacBook Pro, given its clamshell design. And there hasn&#39;t been much traction to suggestions that the MacBooks might come in bright colors a la the iMac 24.</p>\r\n\r\n<p>CNET APPLE REPORT</p>\r\n\r\n<p>Stay up-to-date on the latest news, reviews and advice on iPhones, iPads, Macs, services and software.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>SIGN ME UP!</p>\r\n\r\n<p>By signing up, you agree to our&nbsp;<a href=\"https://redventures.com/CMG-terms-of-use.html\" target=\"_blank\">Terms of Use</a>&nbsp;and acknowledge the data practices in our&nbsp;<a href=\"https://redventures.com/privacy-policy.html\" target=\"_blank\">Privacy Policy</a>. You may unsubscribe at any time.</p>\r\n\r\n<h2>Goodbye, Touch Bar?&nbsp;</h2>\r\n\r\n<p>I have never been a fan of the Touch Bar, especially as a replacement for fixed function keys, so I receive these well-regarded&nbsp;<a href=\"https://www.macworld.com/article/235020/apples-next-m1-macbook-pros-might-dump-the-touch-bar-revive-magsafe.html\" target=\"_blank\">rumors about the deprecation of the Touch Bar</a>&nbsp;and return of real function keys with a bit of chair dancing -- and will be very disappointed if they turn out to be untrue. Also, since mini LED typically generates more heat than other backlights, Apple could probably do with less need for heat dissipation near the display.</p>\r\n\r\n<h2>Return of old favorites?</h2>\r\n\r\n<p>Apple had stripped its MacBook Pros of connectors a lot of people had come to rely on, including an HDMI connection, SD card slot and MagSafe connector (not to be confused with the MagSafe charger for the iPhone). Some rumors indicate that we&#39;re getting those back, along with another pair of USB4/Thunderbolt ports. Some news has also indicated a return of the MagSafe connection, but it&#39;s also possible they&#39;re confusing them with the rumors about a new version of the recent&nbsp;<a href=\"https://www.cnet.com/tech/mobile/apple-cites-four-new-iphones-magsafe-charger-in-fcc-filing-ahead-of-sept-14-event/\">FCC filing for a MagSafe charger for the iPhone</a>.&nbsp;</p>\r\n\r\n<h2>A 1080p webcam, but still no Face ID?</h2>\r\n\r\n<p>As Apple introduced an upgraded 1080p webcam first with the 27-inch iMac (and discontinued iMac Pro), then with the 24-inch iMac, it makes sense to integrate one into the MacBook Pro&nbsp;<a href=\"https://twitter.com/dylandkt/status/1413853957634547714\" target=\"_blank\">as widely rumored</a>, since it&#39;s probably used for videoconferencing more than many other of its systems. But while Touch ID is likely to remain, there hasn&#39;t been any welcome word about much-requested Face ID (or 5G) since&nbsp;<a href=\"https://www.bloomberg.com/news/articles/2021-01-22/apple-aapl-plans-new-macbook-air-with-magsafe-macbook-pro-with-sd-card-slot\" target=\"_blank\">we heard in January that it wouldn&#39;t be included</a>.</p>', 551, '2021-09-22 21:00:00', 104, 'MacBook Pro 2021 rumors: Release date, price, M1X and more', 'Significant changes to the MacBook Pro line are rumored to include a new 14-inch size, more powerful M1X processor, mini LED screen and no Touch Bar.', 'tech, pc, phone, software, hardware, IOS, android,  hifi, tv, foto, video', '2021-09-15 03:50:43', '2021-11-05 16:01:57');
